import React, { Component } from 'react'

export class Products extends Component {
  render() {
    return (
      <section className='product'>

      <main className='shopCart'>
        {this.props.items.map(el => (
          <h1>{el.title}</h1>
        ))}
      </main>
      </section>
    )
  }
}

export default Products
